import React from 'react';
import './MainContent.css';

function MainContent() {
  return (
    <main className="main-content">
      <div className="featured-game">
        <img src="path/to/horizon.jpg" alt="Horizon Forbidden West" />
        <h2>Horizon Forbidden West</h2>
      </div>
      <div className="game-thumbnails">
        <div className="thumbnail">
          <img src="path/to/game1.jpg" alt="Game 1" />
        </div>
        <div className="thumbnail">
          <img src="path/to/game2.jpg" alt="Game 2" />
        </div>
        <div className="thumbnail">
          <img src="path/to/game3.jpg" alt="Game 3" />
        </div>
      </div>
    </main>
  );
}

export default MainContent;
